import React from "react";
import "./Profile.style.css";
import Bio from "./Bio";
import Skills from "./Skills";
import SocialLinks from "./SocialLinks";

const Profile = () => {
  return (
    <div className="profile">
      <Bio />
      <Skills />
      <SocialLinks />
    </div>
  );
};

export default Profile;
